import { createRouter, createWebHistory } from 'vue-router'
import HomeComponent from '../components/layouts/HomeBanner.vue';
import LoginComponent from '../components/pages/Login.vue';
import Registration from '../components/pages/Registration.vue';
import SellerRegistration from '../components/pages/SellerRegistration.vue';
import SingleProduct from '../components/layouts/ProductComponents/SingleProduct.vue';
const routes = [
  {
    path: '/',
    name: 'home',
    component: HomeComponent
  },
  {
    path: '/login',
    name: 'login',
    component: LoginComponent
  },
  {
    path: '/registration',
    name: 'registration',
    component: Registration
  },
  {
    path: '/seller/registration',
    name: 'sellerRegistration',
    component: Registration
  },
  {
    path: '/single-product',
    name: 'singleProduct',
    component: SingleProduct
  }
]

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
})

export default router
